export class Gift {
  constructor(id, title, description, photoContentType, photo, points, active, stock, giftShoppingCarts) {
    this.id = id;
    this.title = title;
    this.description = description;
    this.photoContentType = photoContentType;
    this.photo = photo;
    this.points = points;
    this.active = active;
    this.stock = stock;
    this.giftShoppingCarts = giftShoppingCarts;
    this.active = this.active ?? false;
  }
}
export function getGiftIdentifier(gift) {
